import axios from "axios";

const API_URL = "http://localhost:3000";

export const getHello = async () => {
  try {
    const response = await axios.get("${API_URL}/hello");
    return response.data;
  } catch (error) {
    console.error("Error faching data", error);
    throw error;
  }
};
